using System;

namespace Day_2
{
    internal static class Program
    {
        #region Input
        private static readonly string[] Input =
        {
            "",
            "",
            "",
            "",
            ""
        };
        #endregion

        private static int _lastRow = 1;
        private static int _lastColumn = 1;

        private static void Main()
        {
            foreach (var key in Input)
            {
                Console.Write(ProcessSequence(key));
            }

            Console.Read();
        }

        private static int ProcessSequence(string key)
        {
            foreach (var ch in key)
            {
                switch (ch)
                {
                    case 'U':
                        if (_lastRow > 0) _lastRow--;
                        break;
                    case 'D':
                        if (_lastRow < 2) _lastRow++;
                        break;
                    case 'L':
                        if (_lastColumn > 0) _lastColumn--;
                        break;
                    case 'R':
                        if (_lastColumn < 2) _lastColumn++;
                        break;
                    default:
                        throw new ArgumentOutOfRangeException();
                }
            }

            return _lastRow * 3 + _lastColumn + 1;
        }
    }
}
